import { makeStyles } from "@mui/styles";

export const useStyles = makeStyles({
  blockSubmit:{
    display:'flex',
    marginTop:20,
    alignItems:'center',
    justifyContent:'space-between'
  },
  createProfile:{
    backgroundColor:'rgba(25, 118, 210,0.2)',
    textAlign:"center",
    paddingTop:10,
    paddingBottom:10,
    marginTop:10,
    borderRadius:15,
    '& input':{
      color:'#363e45'
    }
  }
})
